import React, { useState, useEffect } from 'react';
import axios from 'axios'


const App = () => {
  const [data, setData] = useState()

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        'dolls'
      )
      setData(result.data)
      console.log(data)
    } 
    fetchData()
  }, [])

  return (
    <div>lala</div>
  )
}

export default App;
